const videos = [
    {
        name: 'Голова',
        duration: 10,
    },
    {
        name: 'Плечи',
        duration: 20,
    },
    {
        name: 'Руки',
        duration: 30,
    },
    {
        name: 'Тело',
        duration: 40,
    },
    {
        name: 'Ноги',
        duration: 50,
    },
]

export function VideoList() {
    return (
    <div class="video">
        <h1>Список Видео:</h1>
        <div>Название видео</div>
        <div>Длительность</div>
        <button>Like!</button>
    </div>
    )
}
